// SPDX-License-Identifier: MIT

pragma solidity ^0.8.28;

import "./token/ERC20/extensions/ERC20Pausable.sol";

contract MyERC is ERC20Pausable {
    constructor() ERC20("LOL", "LOL") {}

    function pause() public {
        _pause();
    }

    function unpause() public {
        _unpause();
    }
}

